public static Object parse(String text, ParserConfig config, int features) {
    if (text == null) {
        return null;
    }
    DefaultJSONParser parser = new DefaultJSONParser(text, config, features);
    Object value = parser.parse();
    parser.handleResovleTask(value);
    parser.close();
    return value;
