private boolean any() {
    switch(ch) {
        case '{':
            next();
            while (isWhiteSpace(ch)) {
                next();
            }
            if (ch == '}') {
                next();
                type = Type.Object;
                return true;
            }
            for (; ; ) {
                if (ch == '"') {
                    fieldName();
                } else {
                    return false;
                }
                skipWhiteSpace();
                if (ch == ':') {
                    next();
                } else {
                    return false;
                }
                skipWhiteSpace();
                if (!any()) {
                    return false;
                }
                // kv 结束时，只能是 "," 或 "}"
                skipWhiteSpace();
                if (ch == ',') {
                    next();
                    skipWhiteSpace();
                } else if (ch == '}') {
                    next();
                    type = Type.Object;
                    return true;
                } else {
                    return false;
                }
            }
        case '[':
            next();
            skipWhiteSpace();
            if (ch == ']') {
                next();
                type = Type.Array;
                return true;
            }
            for (; ; ) {
                if (!any()) {
                    return false;
                }
                skipWhiteSpace();
                if (ch == ',') {
                    next();
                    skipWhiteSpace();
                } else if (ch == ']') {
                    next();
                    type = Type.Array;
                    return true;
                } else {
                    return false;
                }
            }
        case '0':
        case '1':
        case '2':
        case '3':
        case '4':
        case '5':
        case '6':
        case '7':
        case '8':
        case '9':
        case '+':
        case '-':
            if (ch == '-' || ch == '+') {
                next();
                skipWhiteSpace();
                if (ch < '0' || ch > '9') {
                    return false;
                }
            }
            do {
                next();
            } while (ch >= '0' && ch <= '9');
            if (ch == '.') {
                next();
                // bug fix: 0.e7 should not pass the test
                if (ch < '0' || ch > '9') {
                    return false;
                }
                while (ch >= '0' && ch <= '9') {
                    next();
                }
            }
            if (ch == 'e' || ch == 'E') {
                next();
                if (ch == '-' || ch == '+') {
                    next();
                }
                if (ch >= '0' && ch <= '9') {
                    next();
                } else {
                    return false;
                }
                while (ch >= '0' && ch <= '9') {
                    next();
                }
            }
            type = Type.Value;
            break;
        case '"':
            next();
            for (; ; ) {
                if (eof) {
                    return false;
                }
                if (ch == '\\') {
                    next();
                    if (ch == 'u') {
                        next();
                        next();
                        next();
                        next();
                        next();
                    } else {
                        next();
                    }
                } else if (ch == '"') {
                    next();
                    type = Type.Value;
                    return true;
                } else {
                    next();
                }
            }
        case 't':
            next();
            if (ch != 'r') {
                return false;
            }
            next();
            if (ch != 'u') {
                return false;
            }
            next();
            if (ch != 'e') {
                return false;
            }
            next();
            if (isWhiteSpace(ch) || ch == ',' || ch == ']' || ch == '}' || ch == '\0') {
                type = Type.Value;
                return true;
            }
            return false;
        case 'f':
            next();
            if (ch != 'a') {
                return false;
            }
            next();
            if (ch != 'l') {
                return false;
            }
            next();
            if (ch != 's') {
                return false;
            }
            next();
            if (ch != 'e') {
                return false;
            }
            next();
            if (isWhiteSpace(ch) || ch == ',' || ch == ']' || ch == '}' || ch == '\0') {
                type = Type.Value;
                return true;
            }
            return false;
        case 'n':
            next();
            if (ch != 'u') {
                return false;
            }
            next();
            if (ch != 'l') {
                return false;
            }
            next();
            if (ch != 'l') {
                return false;
            }
            next();
            if (isWhiteSpace(ch) || ch == ',' || ch == ']' || ch == '}' || ch == '\0') {
                type = Type.Value;
                return true;
            }
            return false;
        default:
            return false;
    }
    return true;
}

private Type handlerParameterizedType(ParameterizedType type, Type[] actualTypeArguments, int actualIndex) {
    Class<?> thisClass = this.getClass();
    Type rawType = type.getRawType();
    Type[] argTypes = type.getActualTypeArguments();
    for (int i = 0; i < argTypes.length; ++i) {
        if (argTypes[i] instanceof TypeVariable && actualIndex < actualTypeArguments.length) {
            argTypes[i] = actualTypeArguments[actualIndex++];
        }
        // fix for openjdk and android env
        if (argTypes[i] instanceof GenericArrayType) {
            argTypes[i] = TypeUtils.checkPrimitiveArray((GenericArrayType) argTypes[i]);
        }
        // 如果有多层泛型且该泛型已经注明实现的情况下，判断该泛型下一层是否还有泛型
        if (argTypes[i] instanceof ParameterizedType) {
            argTypes[i] = handlerParameterizedType((ParameterizedType) argTypes[i], actualTypeArguments, actualIndex);
        }
    }
    Type key = new ParameterizedTypeImpl(argTypes, thisClass, rawType);
    return key;
}

