/**
 * Puts a byte into this byte vector. The byte vector is automatically enlarged
 * if necessary.
 *
 * @param b a byte.
 * @return this byte vector.
 */
public ByteVector putByte(final int b) {
    int length = this.length;
    if (length + 1 > data.length) {
        enlarge(1);
    }
    data[length++] = (byte) b;
    this.length = length;
    return this;
}

/**
 * Puts two bytes into this byte vector. The byte vector is automatically
 * enlarged if necessary.
 *
 * @param b1 a byte.
 * @param b2 another byte.
 * @return this byte vector.
 */
ByteVector put11(final int b1, final int b2) {
    int length = this.length;
    if (length + 2 > data.length) {
        enlarge(2);
    }
    final byte[] data = this.data;
    data[length++] = (byte) b1;
    data[length++] = (byte) b2;
    this.length = length;
    return this;
}

/**
 * Puts a short into this byte vector. The byte vector is automatically enlarged
 * if necessary.
 *
 * @param s a short.
 * @return this byte vector.
 */
public ByteVector putShort(final int s) {
    int length = this.length;
    if (length + 2 > data.length) {
        enlarge(2);
    }
    final byte[] data = this.data;
    data[length++] = (byte) (s >>> 8);
    data[length++] = (byte) s;
    this.length = length;
    return this;
}

/**
 * Puts a byte and a short into this byte vector. The byte vector is
 * automatically enlarged if necessary.
 *
 * @param b a byte.
 * @param s a short.
 * @return this byte vector.
 */
public ByteVector put12(final int b, final int s) {
    int length = this.length;
    if (length + 3 > data.length) {
        enlarge(3);
    }
    final byte[] data = this.data;
    data[length++] = (byte) b;
    data[length++] = (byte) (s >>> 8);
    data[length++] = (byte) s;
    this.length = length;
    return this;
}

/**
 * Puts an int into this byte vector. The byte vector is automatically enlarged
 * if necessary.
 *
 * @param i an int.
 * @return this byte vector.
 */
public ByteVector putInt(final int i) {
    int length = this.length;
    if (length + 4 > data.length) {
        enlarge(4);
    }
    final byte[] data = this.data;
    data[length++] = (byte) (i >>> 24);
    data[length++] = (byte) (i >>> 16);
    data[length++] = (byte) (i >>> 8);
    data[length++] = (byte) i;
    this.length = length;
    return this;
}

/**
 * Puts an UTF8 string into this byte vector. The byte vector is automatically
 * enlarged if necessary.
 *
 * @param s a String.
 * @return this byte vector.
 */
public ByteVector putUTF8(final String s) {
    final int charLength = s.length();
    int len = length;
    if (len + 2 + charLength > data.length) {
        enlarge(2 + charLength);
    }
    final byte[] data = this.data;
    // optimistic algorithm: instead of computing the byte length and then
    // serializing the string (which requires two loops), we assume the byte
    // length is equal to char length (which is the most frequent case), and
    // we start serializing the string right away. During the serialization,
    // if we find that this assumption is wrong, we continue with the
    // general method.
    data[len++] = (byte) (charLength >>> 8);
    data[len++] = (byte) charLength;
    for (int i = 0; i < charLength; ++i) {
        final char c = s.charAt(i);
        if ((c >= '\001' && c <= '\177') || (c >= '\u4E00' && c <= '\u9FFF')) {
            data[len++] = (byte) c;
        } else {
            throw new UnsupportedOperationException();
        }
    }
    length = len;
    return this;
}

/**
 * Puts an array of bytes into this byte vector. The byte vector is
 * automatically enlarged if necessary.
 *
 * @param b   an array of bytes. May be <tt>null</tt> to put <tt>len</tt> null
 *            bytes into this byte vector.
 * @param off index of the fist byte of b that must be copied.
 * @param len number of bytes of b that must be copied.
 * @return this byte vector.
 */
public ByteVector putByteArray(final byte[] b, final int off, final int len) {
    if (length + len > data.length) {
        enlarge(len);
    }
    if (b != null) {
        System.arraycopy(b, off, data, length, len);
    }
    length += len;
    return this;
}

/**
 * Enlarge this byte vector so that it can receive n more bytes.
 *
 * @param size number of additional bytes that this byte vector should be able
 *             to receive.
 */
private void enlarge(final int size) {
    final int length1 = 2 * data.length;
    final int length2 = length + size;
    final byte[] newData = new byte[length1 > length2 ? length1 : length2];
    System.arraycopy(data, 0, newData, 0, length);
    data = newData;
}

public void accept(final TypeCollector classVisitor) {
    // buffer used to read strings
    char[] c = new char[maxStringLength];
    // loop variables
    int i, j;
    // indexes in b
    int u, v;
    int anns = 0;
    // read annotations
    if (readAnnotations) {
        u = getAttributes();
        for (i = readUnsignedShort(u); i > 0; --i) {
            String attrName = readUTF8(u + 2, c);
            if ("RuntimeVisibleAnnotations".equals(attrName)) {
                anns = u + 8;
                break;
            }
            u += 6 + readInt(u + 4);
        }
    }
    // visits the header
    u = header;
    int len = readUnsignedShort(u + 6);
    u += 8;
    for (i = 0; i < len; ++i) {
        u += 2;
    }
    v = u;
    i = readUnsignedShort(v);
    v += 2;
    for (; i > 0; --i) {
        j = readUnsignedShort(v + 6);
        v += 8;
        for (; j > 0; --j) {
            v += 6 + readInt(v + 2);
        }
    }
    i = readUnsignedShort(v);
    v += 2;
    for (; i > 0; --i) {
        j = readUnsignedShort(v + 6);
        v += 8;
        for (; j > 0; --j) {
            v += 6 + readInt(v + 2);
        }
    }
    i = readUnsignedShort(v);
    v += 2;
    for (; i > 0; --i) {
        v += 6 + readInt(v + 2);
    }
    if (anns != 0) {
        for (i = readUnsignedShort(anns), v = anns + 2; i > 0; --i) {
            String name = readUTF8(v, c);
            classVisitor.visitAnnotation(name);
        }
    }
    // visits the fields
    i = readUnsignedShort(u);
    u += 2;
    for (; i > 0; --i) {
        j = readUnsignedShort(u + 6);
        u += 8;
        for (; j > 0; --j) {
            u += 6 + readInt(u + 2);
        }
    }
    // visits the methods
    i = readUnsignedShort(u);
    u += 2;
    for (; i > 0; --i) {
        // inlined in original ASM source, now a method call
        u = readMethod(classVisitor, c, u);
    }
}

private int getAttributes() {
    // skips the header
    int u = header + 8 + readUnsignedShort(header + 6) * 2;
    // skips fields and methods
    for (int i = readUnsignedShort(u); i > 0; --i) {
        for (int j = readUnsignedShort(u + 8); j > 0; --j) {
            u += 6 + readInt(u + 12);
        }
        u += 8;
    }
    u += 2;
    for (int i = readUnsignedShort(u); i > 0; --i) {
        for (int j = readUnsignedShort(u + 8); j > 0; --j) {
            u += 6 + readInt(u + 12);
        }
        u += 8;
    }
    // the attribute_info structure starts just after the methods
    return u + 2;
}

