public static int getArgumentsAndReturnSizes(final String desc) {
    int n = 1;
    int c = 1;
    while (true) {
        char car = desc.charAt(c++);
        if (car == ')') {
            car = desc.charAt(c);
            return n << 2 | (car == 'V' ? 0 : (car == 'D' || car == 'J' ? 2 : 1));
        } else if (car == 'L') {
            while (desc.charAt(c++) != ';') {
            }
            n += 1;
            // } else if (car == '[') {
            // while ((car = desc.charAt(c)) == '[') {
            // ++c;
            // }
            // if (car == 'D' || car == 'J') {
            // n -= 1;
            // }
        } else if (car == 'D' || car == 'J') {
            n += 2;
        } else {
            n += 1;
        }
    }
}

