/**
 * Returns the Java type corresponding to the given type descriptor.
 *
 * @param buf a buffer containing a type descriptor.
 * @param off the offset of this descriptor in the previous buffer.
 * @return the Java type corresponding to the given type descriptor.
 */
private static Type getType(final char[] buf, final int off) {
    int len;
    switch(buf[off]) {
        case 'V':
            return VOID_TYPE;
        case 'Z':
            return BOOLEAN_TYPE;
        case 'C':
            return CHAR_TYPE;
        case 'B':
            return BYTE_TYPE;
        case 'S':
            return SHORT_TYPE;
        case 'I':
            return INT_TYPE;
        case 'F':
            return FLOAT_TYPE;
        case 'J':
            return LONG_TYPE;
        case 'D':
            return DOUBLE_TYPE;
        case '[':
            len = 1;
            while (buf[off + len] == '[') {
                ++len;
            }
            if (buf[off + len] == 'L') {
                ++len;
                while (buf[off + len] != ';') {
                    ++len;
                }
            }
            return new Type(9, /*ARRAY*/
            buf, off, len + 1);
        // case 'L':
        default:
            len = 1;
            while (buf[off + len] != ';') {
                ++len;
            }
            return new Type(10, /*OBJECT*/
            buf, off + 1, len - 1);
    }
}

// ------------------------------------------------------------------------
// Conversion to type descriptors
// ------------------------------------------------------------------------
/**
 * Returns the descriptor corresponding to this Java type.
 *
 * @return the descriptor corresponding to this Java type.
 */
String getDescriptor() {
    return new String(this.buf, off, len);
}

static Type[] getArgumentTypes(final String methodDescriptor) {
    char[] buf = methodDescriptor.toCharArray();
    int off = 1;
    int size = 0;
    for (; ; ) {
        char car = buf[off++];
        if (car == ')') {
            break;
        } else if (car == 'L') {
            while (buf[off++] != ';') {
            }
            ++size;
        } else if (car != '[') {
            ++size;
        }
    }
    Type[] args = new Type[size];
    off = 1;
    size = 0;
    while (buf[off] != ')') {
        args[size] = getType(buf, off);
        off += args[size].len + (args[size].sort == 10 ? /*OBJECT*/
        2 : 0);
        size += 1;
    }
    return args;
}

protected String getClassName() {
    switch(sort) {
        case // VOID:
        0:
            return "void";
        case // BOOLEAN:
        1:
            return "boolean";
        case // CHAR:
        2:
            return "char";
        case // BYTE:
        3:
            return "byte";
        case // SHORT:
        4:
            return "short";
        case // INT:
        5:
            return "int";
        case // FLOAT:
        6:
            return "float";
        case // LONG:
        7:
            return "long";
        case // DOUBLE:
        8:
            return "double";
        case // ARRAY:
        9:
            Type elementType = getType(buf, off + getDimensions());
            StringBuilder b = new StringBuilder(elementType.getClassName());
            for (int i = getDimensions(); i > 0; --i) {
                b.append("[]");
            }
            return b.toString();
        // case OBJECT:
        default:
            return new String(buf, off, len).replace('/', '.');
    }
}

private boolean correctTypeName(Type type, String paramTypeName) {
    String s = type.getClassName();
    // array notation needs cleanup.
    StringBuilder braces = new StringBuilder();
    while (s.endsWith("[]")) {
        braces.append('[');
        s = s.substring(0, s.length() - 2);
    }
    if (braces.length() != 0) {
        if (primitives.containsKey(s)) {
            s = braces.append(primitives.get(s)).toString();
        } else {
            s = braces.append('L').append(s).append(';').toString();
        }
    }
    return s.equals(paramTypeName);
}

