public final void nextToken() {
    sp = 0;
    for (; ; ) {
        pos = bp;
        if (ch == '/') {
            skipComment();
            continue;
        }
        if (ch == '"') {
            scanString();
            return;
        }
        if (ch == ',') {
            next();
            token = COMMA;
            return;
        }
        if (ch >= '0' && ch <= '9') {
            scanNumber();
            return;
        }
        if (ch == '-') {
            scanNumber();
            return;
        }
        switch(ch) {
            case '\'':
                if (!isEnabled(Feature.AllowSingleQuotes)) {
                    throw new JSONException("Feature.AllowSingleQuotes is false");
                }
                scanStringSingleQuote();
                return;
            case ' ':
            case '\t':
            case '\b':
            case '\f':
            case '\n':
            case '\r':
                next();
                break;
            case // true
            't':
                scanTrue();
                return;
            case // false
            'f':
                scanFalse();
                return;
            case // new,null
            'n':
                scanNullOrNew();
                return;
            case 'T':
            // NULL
            case 'N':
            case 'S':
            case // undefined
            'u':
                scanIdent();
                return;
            case '(':
                next();
                token = LPAREN;
                return;
            case ')':
                next();
                token = RPAREN;
                return;
            case '[':
                next();
                token = LBRACKET;
                return;
            case ']':
                next();
                token = RBRACKET;
                return;
            case '{':
                next();
                token = LBRACE;
                return;
            case '}':
                next();
                token = RBRACE;
                return;
            case ':':
                next();
                token = COLON;
                return;
            case ';':
                next();
                token = SEMI;
                return;
            case '.':
                next();
                token = DOT;
                return;
            case '+':
                next();
                scanNumber();
                return;
            case 'x':
                scanHex();
                return;
            default:
                if (isEOF()) {
                    // JLS
                    if (token == EOF) {
                        throw new JSONException("EOF error");
                    }
                    token = EOF;
                    eofPos = pos = bp;
                } else {
                    if (ch <= 31 || ch == 127) {
                        next();
                        break;
                    }
                    lexError("illegal.char", String.valueOf((int) ch));
                    next();
                }
                return;
        }
    }
}

public final Number integerValue() throws NumberFormatException {
    long result = 0;
    boolean negative = false;
    if (np == -1) {
        np = 0;
    }
    int i = np, max = np + sp;
    long limit;
    long multmin;
    int digit;
    char type = ' ';
    switch(charAt(max - 1)) {
        case 'L':
            max--;
            type = 'L';
            break;
        case 'S':
            max--;
            type = 'S';
            break;
        case 'B':
            max--;
            type = 'B';
            break;
        default:
            break;
    }
    if (charAt(np) == '-') {
        negative = true;
        limit = Long.MIN_VALUE;
        i++;
    } else {
        limit = -Long.MAX_VALUE;
    }
    multmin = MULTMIN_RADIX_TEN;
    if (i < max) {
        digit = charAt(i++) - '0';
        result = -digit;
    }
    while (i < max) {
        // Accumulating negatively avoids surprises near MAX_VALUE
        digit = charAt(i++) - '0';
        if (result < multmin) {
            return new BigInteger(numberString(), 10);
        }
        result *= 10;
        if (result < limit + digit) {
            return new BigInteger(numberString(), 10);
        }
        result -= digit;
    }
    if (negative) {
        if (i > np + 1) {
            if (result >= Integer.MIN_VALUE && type != 'L') {
                if (type == 'S') {
                    return (short) result;
                }
                if (type == 'B') {
                    return (byte) result;
                }
                return (int) result;
            }
            return result;
        } else {
            /* Only got "-" */
            throw new JSONException("illegal number format : " + numberString());
        }
    } else {
        result = -result;
        if (result <= Integer.MAX_VALUE && type != 'L') {
            if (type == 'S') {
                return (short) result;
            }
            if (type == 'B') {
                return (byte) result;
            }
            return (int) result;
        }
        return result;
    }
}

