            this.ch = this.charAt(bp);
        } else if (chLocal == EOI) {
            token = JSONToken.EOF;
            bp += (offset - 1);
            ch = EOI;
        } else {
            matchStat = NOT_MATCH;
            return null;
        }
        matchStat = END;
    } else {
        matchStat = NOT_MATCH;
        return null;
    }
    return uuid;
}

public static String readString(char[] chars, int chars_len) {
    char[] sbuf = new char[chars_len];
    int len = 0;
    for (int i = 0; i < chars_len; ++i) {
        char ch = chars[i];
        if (ch != '\\') {
            sbuf[len++] = ch;
            continue;
        }
        ch = chars[++i];
        switch(ch) {
            case '0':
                sbuf[len++] = '\0';
                break;
            case '1':
                sbuf[len++] = '\1';
                break;
            case '2':
                sbuf[len++] = '\2';
                break;
            case '3':
                sbuf[len++] = '\3';
                break;
            case '4':
                sbuf[len++] = '\4';
                break;
            case '5':
                sbuf[len++] = '\5';
                break;
            case '6':
                sbuf[len++] = '\6';
                break;
            case '7':
                sbuf[len++] = '\7';
                break;
            case // 8
            'b':
                sbuf[len++] = '\b';
                break;
            case // 9
            't':
                sbuf[len++] = '\t';
                break;
            case // 10
            'n':
                sbuf[len++] = '\n';
                break;
            case // 11
            'v':
                sbuf[len++] = '\u000B';
                break;
            // 12
            case 'f':
            case 'F':
                sbuf[len++] = '\f';
                break;
            case // 13
            'r':
                sbuf[len++] = '\r';
                break;
            case // 34
            '"':
                sbuf[len++] = '"';
                break;
            case // 39
            '\'':
                sbuf[len++] = '\'';
                break;
            case // 47
            '/':
                sbuf[len++] = '/';
                break;
            case // 92
            '\\':
                sbuf[len++] = '\\';
                break;
            case 'x':
                sbuf[len++] = (char) (digits[chars[++i]] * 16 + digits[chars[++i]]);
                break;
            case 'u':
                sbuf[len++] = (char) Integer.parseInt(new String(new char[] { // 
                chars[++i], // 
                chars[++i], // 
                chars[++i], chars[++i] }), 16);
                break;
            default:
                throw new JSONException("unclosed.str.lit");
        }
    }
    return new String(sbuf, 0, len);
}

private void scanStringSingleQuote() {
    np = bp;
    hasSpecial = false;
    char chLocal;
    for (; ; ) {
        chLocal = next();
        if (chLocal == '\'') {
            break;
        }
        if (chLocal == EOI) {
            if (!isEOF()) {
                putChar((char) EOI);
                continue;
            }
            throw new JSONException("unclosed single-quote string");
        }
        if (chLocal == '\\') {
            if (!hasSpecial) {
                hasSpecial = true;
                if (sp > sbuf.length) {
                    char[] newsbuf = new char[sp * 2];
                    System.arraycopy(sbuf, 0, newsbuf, 0, sbuf.length);
                    sbuf = newsbuf;
                }
                // text.getChars(offset, offset + count, dest, 0);
                this.copyTo(np + 1, sp, sbuf);
                // System.arraycopy(buf, np + 1, sbuf, 0, sp);
            }
            chLocal = next();
            switch(chLocal) {
                case '0':
                    putChar('\0');
                    break;
                case '1':
                    putChar('\1');
                    break;
                case '2':
                    putChar('\2');
                    break;
                case '3':
                    putChar('\3');
                    break;
                case '4':
                    putChar('\4');
                    break;
                case '5':
                    putChar('\5');
                    break;
                case '6':
                    putChar('\6');
                    break;
                case '7':
                    putChar('\7');
                    break;
                case // 8
                'b':
                    putChar('\b');
                    break;
                case // 9
                't':
                    putChar('\t');
                    break;
                case // 10
                'n':
                    putChar('\n');
                    break;
                case // 11
                'v':
                    putChar('\u000B');
                    break;
                // 12
                case 'f':
                case 'F':
                    putChar('\f');
                    break;
                case // 13
                'r':
                    putChar('\r');
                    break;
                case // 34
                '"':
                    putChar('"');
                    break;
                case // 39
                '\'':
                    putChar('\'');
                    break;
                case // 47
                '/':
                    putChar('/');
                    break;
                case // 92
                '\\':
                    putChar('\\');
                    break;
                case 'x':
                    char x1 = next();
                    char x2 = next();
                    boolean hex1 = (x1 >= '0' && x1 <= '9') || (x1 >= 'a' && x1 <= 'f') || (x1 >= 'A' && x1 <= 'F');
                    boolean hex2 = (x2 >= '0' && x2 <= '9') || (x2 >= 'a' && x2 <= 'f') || (x2 >= 'A' && x2 <= 'F');
                    if (!hex1 || !hex2) {
                        throw new JSONException("invalid escape character \\x" + x1 + x2);
                    }
                    putChar((char) (digits[x1] * 16 + digits[x2]));
                    break;
                case 'u':
                    putChar((char) Integer.parseInt(new String(new char[] { next(), next(), next(), next() }), 16));
                    break;
                default:
                    this.ch = chLocal;
                    throw new JSONException("unclosed single-quote string");
            }
            continue;
        }
        if (!hasSpecial) {
            sp++;
            continue;
        }
        if (sp == sbuf.length) {
            putChar(chLocal);
        } else {
            sbuf[sp++] = chLocal;
        }
    }
    token = LITERAL_STRING;
    this.next();
}

/**
 * Append a character to sbuf.
 */
protected final void putChar(char ch) {
    if (sp >= sbuf.length) {
        int len = sbuf.length * 2;
        if (len < sp) {
            len = sp + 1;
        }
        char[] newsbuf = new char[len];
        System.arraycopy(sbuf, 0, newsbuf, 0, sbuf.length);
        sbuf = newsbuf;
    }
    sbuf[sp++] = ch;
}

public final long longValue() throws NumberFormatException {
    long result = 0;
    boolean negative = false;
    long limit;
    int digit;
    if (np == -1) {
        np = 0;
    }
    int i = np, max = np + sp;
    if (charAt(np) == '-') {
        negative = true;
        limit = Long.MIN_VALUE;
        i++;
    } else {
        limit = -Long.MAX_VALUE;
    }
    long multmin = MULTMIN_RADIX_TEN;
    if (i < max) {
        digit = charAt(i++) - '0';
        result = -digit;
    }
    while (i < max) {
        // Accumulating negatively avoids surprises near MAX_VALUE
        char chLocal = charAt(i++);
        if (chLocal == 'L' || chLocal == 'S' || chLocal == 'B') {
            break;
        }
        digit = chLocal - '0';
        if (result < multmin) {
            throw new NumberFormatException(numberString());
        }
        result *= 10;
        if (result < limit + digit) {
            throw new NumberFormatException(numberString());
        }
        result -= digit;
    }
    if (negative) {
        if (i > np + 1) {
            return result;
        } else {
            /* Only got "-" */
            throw new NumberFormatException(numberString());
        }
    } else {
        return -result;
    }
}

public static boolean isWhitespace(char ch) {
    // 专门调整了判断顺序
    return ch <= ' ' && (ch == ' ' || ch == '\n' || ch == '\r' || ch == '\t' || ch == '\f' || ch == '\b');
}

