            millis = -millis;
        }
        dateVal = new java.util.Date(millis);
    } else {
        matchStat = NOT_MATCH;
        return null;
    }
    if (ch == ',') {
        this.ch = charAt(++bp);
        matchStat = VALUE;
        token = JSONToken.COMMA;
        return dateVal;
    } else {
        // condition ch == '}' is always 'true'
        ch = charAt(++bp);
        if (ch == ',') {
            token = JSONToken.COMMA;
            this.ch = charAt(++bp);
        } else if (ch == ']') {
