// for hsf support
public String[] scanFieldStringArray(char[] fieldName, int argTypesCount, SymbolTable typeSymbolTable) {
    int startPos = bp;
    char starChar = ch;
    while (isWhitespace(ch)) {
        next();
    }
    int offset;
    char ch;
    if (fieldName != null) {
        matchStat = UNKNOWN;
        if (!charArrayCompare(fieldName)) {
            matchStat = NOT_MATCH_NAME;
            return null;
        }
        offset = bp + fieldName.length;
        ch = text.charAt(offset++);
        while (isWhitespace(ch)) {
            ch = text.charAt(offset++);
        }
        if (ch == ':') {
            ch = text.charAt(offset++);
        } else {
            matchStat = NOT_MATCH;
            return null;
        }
        while (isWhitespace(ch)) {
            ch = text.charAt(offset++);
        }
    } else {
        offset = bp + 1;
        ch = this.ch;
    }
    if (ch == '[') {
        bp = offset;
        this.ch = text.charAt(bp);
    } else if (ch == 'n' && text.startsWith("ull", bp + 1)) {
        bp += 4;
        this.ch = text.charAt(bp);
        return null;
    } else {
        matchStat = NOT_MATCH;
        return null;
    }
    String[] types = argTypesCount >= 0 ? new String[argTypesCount] : new String[4];
    int typeIndex = 0;
    for (; ; ) {
        while (isWhitespace(this.ch)) {
            next();
        }
        if (this.ch != '\"') {
            this.bp = startPos;
            this.ch = starChar;
            matchStat = NOT_MATCH;
            return null;
        }
        String type = scanSymbol(typeSymbolTable, '"');
        if (typeIndex == types.length) {
            int newCapacity = types.length + (types.length >> 1) + 1;
            String[] array = new String[newCapacity];
            System.arraycopy(types, 0, array, 0, types.length);
            types = array;
        }
        types[typeIndex++] = type;
        while (isWhitespace(this.ch)) {
            next();
        }
        if (this.ch == ',') {
            next();
            continue;
        }
        break;
    }
    if (types.length != typeIndex) {
        String[] array = new String[typeIndex];
        System.arraycopy(types, 0, array, 0, typeIndex);
        types = array;
    }
    while (isWhitespace(this.ch)) {
        next();
    }
    if (this.ch == ']') {
        next();
    } else {
        this.bp = startPos;
        this.ch = starChar;
        matchStat = NOT_MATCH;
        return null;
    }
    return types;
}

public final void skipObject(boolean valid) {
    boolean quote = false;
    int braceCnt = 0;
    int i = bp;
    for (; i < text.length(); ++i) {
        final char ch = text.charAt(i);
        if (ch == '\\') {
            if (i < len - 1) {
                ++i;
                continue;
            } else {
                this.ch = ch;
                this.bp = i;
                throw new JSONException("illegal str, " + info());
            }
        } else if (ch == '"') {
            quote = !quote;
        } else if (ch == '{') {
            if (quote) {
                continue;
            }
            braceCnt++;
        } else if (ch == '}') {
            if (quote) {
                continue;
            } else {
                braceCnt--;
            }
            if (braceCnt == -1) {
                this.bp = i + 1;
                if (this.bp == text.length()) {
                    this.ch = EOI;
                    this.token = JSONToken.EOF;
                    return;
                }
                this.ch = text.charAt(this.bp);
                if (this.ch == ',') {
                    token = JSONToken.COMMA;
                    int index = ++bp;
                    this.ch = (// 
                    index >= text.length() ? // 
                    EOI : text.charAt(index));
                    return;
                } else if (this.ch == '}') {
                    token = JSONToken.RBRACE;
                    next();
                    return;
                } else if (this.ch == ']') {
                    token = JSONToken.RBRACKET;
                    next();
                    return;
                } else {
                    nextToken(JSONToken.COMMA);
                }
                return;
            }
        }
    }
    for (int j = 0; j < bp; j++) {
        if (j < text.length() && text.charAt(j) == ' ') {
            i++;
        }
    }
    if (i == text.length()) {
        throw new JSONException("illegal str, " + info());
    }
}

public final void skipArray(boolean valid) {
    boolean quote = false;
    int bracketCnt = 0;
    int i = bp;
    for (; i < text.length(); ++i) {
        char ch = text.charAt(i);
        if (ch == '\\') {
            if (i < len - 1) {
                ++i;
                continue;
            } else {
                this.ch = ch;
                this.bp = i;
                throw new JSONException("illegal str, " + info());
            }
        } else if (ch == '"') {
            quote = !quote;
        } else if (ch == '[') {
            if (quote) {
                continue;
            }
            bracketCnt++;
        } else if (ch == '{' && valid) {
            {
                int index = ++bp;
                this.ch = (// 
                index >= text.length() ? // 
                EOI : text.charAt(index));
            }
            skipObject(valid);
        } else if (ch == ']') {
            if (quote) {
                continue;
            } else {
                bracketCnt--;
            }
            if (bracketCnt == -1) {
                this.bp = i + 1;
                if (this.bp == text.length()) {
                    this.ch = EOI;
                    token = JSONToken.EOF;
                    return;
                }
                this.ch = text.charAt(this.bp);
                nextToken(JSONToken.COMMA);
                return;
            }
        }
    }
    if (i == text.length()) {
        throw new JSONException("illegal str, " + info());
    }
}

public boolean seekArrayToItem(int index) {
    if (index < 0) {
        throw new IllegalArgumentException("index must > 0, but " + index);
    }
    if (token == JSONToken.EOF) {
        return false;
    }
    if (token != JSONToken.LBRACKET) {
        throw new UnsupportedOperationException();
    }
    // nextToken();
    for (int i = 0; i < index; ++i) {
        skipWhitespace();
        if (ch == '"' || ch == '\'') {
            skipString();
            if (ch == ',') {
                next();
                continue;
            } else if (ch == ']') {
                next();
                nextToken(JSONToken.COMMA);
                return false;
            } else {
                throw new JSONException("illegal json.");
            }
        } else if (ch == '{') {
            next();
            token = JSONToken.LBRACE;
            skipObject(false);
        } else if (ch == '[') {
            next();
            token = JSONToken.LBRACKET;
            skipArray(false);
        } else {
            boolean match = false;
            for (int j = bp + 1; j < text.length(); ++j) {
                char c = text.charAt(j);
                if (c == ',') {
                    match = true;
                    bp = j + 1;
                    ch = charAt(bp);
                    break;
                } else if (c == ']') {
                    bp = j + 1;
                    ch = charAt(bp);
                    nextToken();
                    return false;
                }
            }
            if (!match) {
                throw new JSONException("illegal json.");
            }
            continue;
        }
        if (token == JSONToken.COMMA) {
            continue;
        } else if (token == JSONToken.RBRACKET) {
            return false;
        } else {
            throw new UnsupportedOperationException();
        }
    }
    nextToken();
    return true;
}

public int seekObjectToField(long fieldNameHash, boolean deepScan) {
    if (token == JSONToken.EOF) {
        return JSONLexer.NOT_MATCH;
    }
    if (token == JSONToken.RBRACE || token == JSONToken.RBRACKET) {
        nextToken();
        return JSONLexer.NOT_MATCH;
    }
    if (token != JSONToken.LBRACE && token != JSONToken.COMMA) {
        throw new UnsupportedOperationException(JSONToken.name(token));
    }
    for (; ; ) {
        if (ch == '}') {
