@SuppressWarnings("unchecked")
public <T> T deserialze(DefaultJSONParser parser, Type clazz, Object fieldName, String format, int features) {
    JSONLexer lexer = parser.lexer;
    Object val;
    if (lexer.token() == JSONToken.LITERAL_INT) {
        long millis = lexer.longValue();
        lexer.nextToken(JSONToken.COMMA);
        if ("unixtime".equals(format)) {
            millis *= 1000;
        }
        val = millis;
    } else if (lexer.token() == JSONToken.LITERAL_STRING) {
        String strVal = lexer.stringVal();
        if (format != null) {
            if ("yyyy-MM-dd HH:mm:ss.SSSSSSSSS".equals(format) && clazz instanceof Class && ((Class) clazz).getName().equals("java.sql.Timestamp")) {
                return (T) TypeUtils.castToTimestamp(strVal);
            }
            SimpleDateFormat simpleDateFormat = null;
            try {
                simpleDateFormat = new SimpleDateFormat(format, parser.lexer.getLocale());
            } catch (IllegalArgumentException ex) {
                if (format.contains("T")) {
                    String fromat2 = format.replaceAll("T", "'T'");
                    try {
                        simpleDateFormat = new SimpleDateFormat(fromat2, parser.lexer.getLocale());
                    } catch (IllegalArgumentException e2) {
                        throw ex;
                    }
                }
            }
            if (JSON.defaultTimeZone != null) {
                simpleDateFormat.setTimeZone(parser.lexer.getTimeZone());
            }
            try {
                val = simpleDateFormat.parse(strVal);
            } catch (ParseException ex) {
                val = null;
                // skip
            }
            if (val == null && JSON.defaultLocale == Locale.CHINA) {
                try {
                    simpleDateFormat = new SimpleDateFormat(format, Locale.US);
                } catch (IllegalArgumentException ex) {
                    if (format.contains("T")) {
                        String fromat2 = format.replaceAll("T", "'T'");
                        try {
                            simpleDateFormat = new SimpleDateFormat(fromat2, parser.lexer.getLocale());
                        } catch (IllegalArgumentException e2) {
                            throw ex;
                        }
                    }
                }
                simpleDateFormat.setTimeZone(parser.lexer.getTimeZone());
                try {
                    val = simpleDateFormat.parse(strVal);
                } catch (ParseException ex) {
                    val = null;
                    // skip
                }
            }
            if (val == null) {
                if (// 
                format.equals("yyyy-MM-dd'T'HH:mm:ss.SSS") && strVal.length() == 19) {
                    try {
                        SimpleDateFormat df = new SimpleDateFormat("yyyy-MM-dd'T'HH:mm:ss", JSON.defaultLocale);
                        df.setTimeZone(JSON.defaultTimeZone);
                        val = df.parse(strVal);
                    } catch (ParseException ex2) {
                        // skip
                        val = null;
                    }
                } else {
                    // skip
                    val = null;
                }
            }
        } else {
            val = null;
        }
        if (val == null) {
            val = strVal;
            lexer.nextToken(JSONToken.COMMA);
            if (lexer.isEnabled(Feature.AllowISO8601DateFormat)) {
                JSONScanner iso8601Lexer = new JSONScanner(strVal);
                if (iso8601Lexer.scanISO8601DateIfMatch()) {
                    val = iso8601Lexer.getCalendar().getTime();
                }
                iso8601Lexer.close();
            }
        }
    } else if (lexer.token() == JSONToken.NULL) {
        lexer.nextToken();
        val = null;
    } else if (lexer.token() == JSONToken.LBRACE) {
        lexer.nextToken();
        String key;
        if (lexer.token() == JSONToken.LITERAL_STRING) {
            key = lexer.stringVal();
            if (JSON.DEFAULT_TYPE_KEY.equals(key)) {
                lexer.nextToken();
                parser.accept(JSONToken.COLON);
                String typeName = lexer.stringVal();
                Class<?> type = parser.getConfig().checkAutoType(typeName, null, lexer.getFeatures());
                if (type != null) {
                    clazz = type;
                }
                parser.accept(JSONToken.LITERAL_STRING);
                parser.accept(JSONToken.COMMA);
            }
            lexer.nextTokenWithColon(JSONToken.LITERAL_INT);
        } else {
            throw new JSONException("syntax error");
        }
        long timeMillis;
        if (lexer.token() == JSONToken.LITERAL_INT) {
            timeMillis = lexer.longValue();
            lexer.nextToken();
        } else {
            throw new JSONException("syntax error : " + lexer.tokenName());
        }
        val = timeMillis;
        parser.accept(JSONToken.RBRACE);
    } else if (parser.getResolveStatus() == DefaultJSONParser.TypeNameRedirect) {
        parser.setResolveStatus(DefaultJSONParser.NONE);
        parser.accept(JSONToken.COMMA);
        if (lexer.token() == JSONToken.LITERAL_STRING) {
            if (!"val".equals(lexer.stringVal())) {
                throw new JSONException("syntax error");
            }
            lexer.nextToken();
        } else {
            throw new JSONException("syntax error");
        }
        parser.accept(JSONToken.COLON);
        val = parser.parse();
        parser.accept(JSONToken.RBRACE);
    } else {
        val = parser.parse();
    }
    return (T) cast(parser, clazz, fieldName, val);
}

@Override
public void parseField(DefaultJSONParser parser, Object object, Type objectType, Map<String, Object> fieldValues) {
    if (this.fieldValueDeserilizer == null) {
        getFieldValueDeserilizer(parser.getConfig());
    }
    ObjectDeserializer fieldValueDeserilizer = this.fieldValueDeserilizer;
    Type fieldType = fieldInfo.fieldType;
    if (objectType instanceof ParameterizedType) {
        ParseContext objContext = parser.getContext();
        if (objContext != null) {
            objContext.type = objectType;
        }
        if (fieldType != objectType) {
            fieldType = FieldInfo.getFieldType(this.clazz, objectType, fieldType);
            if (fieldValueDeserilizer instanceof JavaObjectDeserializer) {
                fieldValueDeserilizer = parser.getConfig().getDeserializer(fieldType);
            }
        }
    }
    // ContextObjectDeserializer
    Object value;
    if (fieldValueDeserilizer instanceof JavaBeanDeserializer && fieldInfo.parserFeatures != 0) {
        JavaBeanDeserializer javaBeanDeser = (JavaBeanDeserializer) fieldValueDeserilizer;
        value = javaBeanDeser.deserialze(parser, fieldType, fieldInfo.name, fieldInfo.parserFeatures);
    } else {
        if ((this.fieldInfo.format != null || this.fieldInfo.parserFeatures != 0) && fieldValueDeserilizer instanceof ContextObjectDeserializer) {
            value = // 
            ((ContextObjectDeserializer) fieldValueDeserilizer).deserialze(parser, fieldType, fieldInfo.name, fieldInfo.format, fieldInfo.parserFeatures);
        } else {
            value = fieldValueDeserilizer.deserialze(parser, fieldType, fieldInfo.name);
        }
    }
    if (value instanceof byte[] && ("gzip".equals(fieldInfo.format) || "gzip,base64".equals(fieldInfo.format))) {
        byte[] bytes = (byte[]) value;
        GZIPInputStream gzipIn = null;
        try {
            gzipIn = new GZIPInputStream(new ByteArrayInputStream(bytes));
            ByteArrayOutputStream byteOut = new ByteArrayOutputStream();
            for (; ; ) {
                byte[] buf = new byte[1024];
                int len = gzipIn.read(buf);
                if (len == -1) {
                    break;
                }
                if (len > 0) {
                    byteOut.write(buf, 0, len);
                }
            }
            value = byteOut.toByteArray();
        } catch (IOException ex) {
            throw new JSONException("unzip bytes error.", ex);
        }
    }
    if (parser.getResolveStatus() == DefaultJSONParser.NeedToResolve) {
        ResolveTask task = parser.getLastResolveTask();
        task.fieldDeserializer = this;
        task.ownerContext = parser.getContext();
        parser.setResolveStatus(DefaultJSONParser.NONE);
    } else {
        if (object == null) {
            fieldValues.put(fieldInfo.name, value);
        } else {
            setValue(object, value);
        }
    }
}

