                    return (T) sqlDate;
                } catch (ParseException e) {
                    // skip
                }
                longVal = Long.parseLong(strVal);
            }
        } finally {
            dateLexer.close();
        }
        return (T) new java.sql.Timestamp(longVal);
    }
    throw new JSONException("parse error");
}

