@SuppressWarnings("unchecked")
public static <T> T deserialze(DefaultJSONParser parser) {
    final JSONLexer lexer = parser.lexer;
    if (lexer.token() == JSONToken.LITERAL_INT) {
        String val = lexer.numberString();
        lexer.nextToken(JSONToken.COMMA);
        if (val.length() > 65535) {
            throw new JSONException("decimal overflow");
        }
        return (T) new BigInteger(val);
    }
    Object value = parser.parse();
    return // 
    value == null ? // 
    null : (T) TypeUtils.castToBigInteger(value);
}

public void write(JSONSerializer serializer, Object object, Object fieldName, Type fieldType, int features) throws IOException {
    SerializeWriter out = serializer.out;
    if (object == null) {
        out.writeNull();
        return;
    }
    Calendar calendar;
    if (object instanceof XMLGregorianCalendar) {
        calendar = ((XMLGregorianCalendar) object).toGregorianCalendar();
    } else {
        calendar = (Calendar) object;
    }
    if (out.isEnabled(SerializerFeature.UseISO8601DateFormat)) {
        final char quote = // 
        out.isEnabled(SerializerFeature.UseSingleQuotes) ? // 
        '\'' : '\"';
        out.append(quote);
        int year = calendar.get(Calendar.YEAR);
        int month = calendar.get(Calendar.MONTH) + 1;
        int day = calendar.get(Calendar.DAY_OF_MONTH);
        int hour = calendar.get(Calendar.HOUR_OF_DAY);
        int minute = calendar.get(Calendar.MINUTE);
        int second = calendar.get(Calendar.SECOND);
        int millis = calendar.get(Calendar.MILLISECOND);
        char[] buf;
        if (millis != 0) {
            buf = "0000-00-00T00:00:00.000".toCharArray();
            IOUtils.getChars(millis, 23, buf);
            IOUtils.getChars(second, 19, buf);
            IOUtils.getChars(minute, 16, buf);
            IOUtils.getChars(hour, 13, buf);
            IOUtils.getChars(day, 10, buf);
            IOUtils.getChars(month, 7, buf);
            IOUtils.getChars(year, 4, buf);
        } else {
            if (second == 0 && minute == 0 && hour == 0) {
                buf = "0000-00-00".toCharArray();
                IOUtils.getChars(day, 10, buf);
                IOUtils.getChars(month, 7, buf);
                IOUtils.getChars(year, 4, buf);
            } else {
                buf = "0000-00-00T00:00:00".toCharArray();
                IOUtils.getChars(second, 19, buf);
                IOUtils.getChars(minute, 16, buf);
                IOUtils.getChars(hour, 13, buf);
                IOUtils.getChars(day, 10, buf);
                IOUtils.getChars(month, 7, buf);
                IOUtils.getChars(year, 4, buf);
            }
        }
        out.write(buf);
        float timeZoneF = calendar.getTimeZone().getOffset(calendar.getTimeInMillis()) / (3600.0f * 1000);
        int timeZone = (int) timeZoneF;
        if (timeZone == 0.0) {
            out.write('Z');
        } else {
            if (timeZone > 9) {
                out.write('+');
                out.writeInt(timeZone);
            } else if (timeZone > 0) {
                out.write('+');
                out.write('0');
                out.writeInt(timeZone);
            } else if (timeZone < -9) {
                out.write('-');
                out.writeInt(timeZone);
            } else if (timeZone < 0) {
                out.write('-');
                out.write('0');
                out.writeInt(-timeZone);
            }
            out.write(':');
            // handles uneven timeZones 30 mins, 45 mins
            // this would always be less than 60
            int offSet = (int) ((timeZoneF - timeZone) * 60);
            out.append(String.format("%02d", offSet));
        }
        out.append(quote);
    } else {
        Date date = calendar.getTime();
        serializer.write(date);
    }
}

@SuppressWarnings("unchecked")
public static <T> T deserialze(DefaultJSONParser parser) {
    final JSONLexer lexer = parser.lexer;
    if (lexer.token() == JSONToken.LITERAL_STRING) {
        String val = lexer.stringVal();
        lexer.nextToken(JSONToken.COMMA);
        return (T) val.toCharArray();
    }
    if (lexer.token() == JSONToken.LITERAL_INT) {
        Number val = lexer.integerValue();
        lexer.nextToken(JSONToken.COMMA);
        return (T) val.toString().toCharArray();
    }
    Object value = parser.parse();
    if (value instanceof String) {
        return (T) ((String) value).toCharArray();
    }
    if (value instanceof Collection) {
        Collection<?> collection = (Collection) value;
        boolean accept = true;
        for (Object item : collection) {
            if (item instanceof String) {
                int itemLength = ((String) item).length();
                if (itemLength != 1) {
                    accept = false;
                    break;
                }
            }
        }
        if (!accept) {
            throw new JSONException("can not cast to char[]");
        }
        char[] chars = new char[collection.size()];
        int pos = 0;
        for (Object item : collection) {
            chars[pos++] = ((String) item).charAt(0);
        }
        return (T) chars;
    }
    return // 
    value == null ? // 
    null : (T) JSON.toJSONString(value).toCharArray();
}

