public void write(JSONSerializer serializer, Object object, Object fieldName, Type fieldType, int features) throws IOException {
    SerializeWriter out = serializer.out;
    if (object == null) {
        out.writeNull(SerializerFeature.WriteNullNumberAsZero);
    } else {
        long value = ((Long) object).longValue();
        out.writeLong(value);
        if (// 
        out.isEnabled(SerializerFeature.WriteClassName) && value <= Integer.MAX_VALUE && // 
        value >= Integer.MIN_VALUE && fieldType != Long.class && fieldType != long.class) {
            out.write('L');
        }
    }
}

@SuppressWarnings("unchecked")
public <T> T deserialze(DefaultJSONParser parser, Type clazz, Object fieldName) {
    final JSONLexer lexer = parser.lexer;
    Long longObject;
    try {
        final int token = lexer.token();
        if (token == JSONToken.LITERAL_INT) {
            long longValue = lexer.longValue();
            lexer.nextToken(JSONToken.COMMA);
            longObject = Long.valueOf(longValue);
        } else if (token == JSONToken.LITERAL_FLOAT) {
            BigDecimal number = lexer.decimalValue();
            longObject = TypeUtils.longValue(number);
            lexer.nextToken(JSONToken.COMMA);
        } else {
            if (token == JSONToken.LBRACE) {
                JSONObject jsonObject = new JSONObject(true);
                parser.parseObject(jsonObject);
                longObject = TypeUtils.castToLong(jsonObject);
            } else {
                Object value = parser.parse();
                longObject = TypeUtils.castToLong(value);
            }
            if (longObject == null) {
                return null;
            }
        }
    } catch (Exception ex) {
        throw new JSONException("parseLong error, field : " + fieldName, ex);
    }
    return // 
    clazz == AtomicLong.class ? // 
    (T) new AtomicLong(longObject.longValue()) : (T) longObject;
}

@SuppressWarnings({ "rawtypes" })
public void write(JSONSerializer serializer, Object object, Object fieldName, Type fieldType, // 
int features, boolean unwrapped) throws IOException {
    SerializeWriter out = serializer.out;
    if (object == null) {
        out.writeNull();
        return;
    }
    Map<?, ?> map = (Map<?, ?>) object;
    final int mapSortFieldMask = SerializerFeature.MapSortField.mask;
    if ((out.features & mapSortFieldMask) != 0 || (features & mapSortFieldMask) != 0) {
        if (map instanceof JSONObject) {
            map = ((JSONObject) map).getInnerMap();
        }
        if ((!(map instanceof SortedMap)) && !(map instanceof LinkedHashMap)) {
            try {
                map = new TreeMap(map);
            } catch (Exception ex) {
                // skip
            }
        }
    }
    if (serializer.containsReference(object)) {
        serializer.writeReference(object);
        return;
    }
    SerialContext parent = serializer.context;
    serializer.setContext(parent, object, fieldName, 0);
    try {
        if (!unwrapped) {
            out.write('{');
        }
        serializer.incrementIndent();
        Class<?> preClazz = null;
        ObjectSerializer preWriter = null;
        boolean first = true;
        if (out.isEnabled(SerializerFeature.WriteClassName)) {
            String typeKey = serializer.config.typeKey;
            Class<?> mapClass = map.getClass();
            boolean containsKey = (mapClass == JSONObject.class || mapClass == HashMap.class || mapClass == LinkedHashMap.class) && map.containsKey(typeKey);
            if (!containsKey) {
                out.writeFieldName(typeKey);
                out.writeString(object.getClass().getName());
                first = false;
            }
        }
        for (Map.Entry entry : map.entrySet()) {
            Object value = entry.getValue();
            Object entryKey = entry.getKey();
            {
                List<PropertyPreFilter> preFilters = serializer.propertyPreFilters;
                if (preFilters != null && preFilters.size() > 0) {
                    if (entryKey == null || entryKey instanceof String) {
                        if (!this.applyName(serializer, object, (String) entryKey)) {
                            continue;
                        }
                    } else if (entryKey.getClass().isPrimitive() || entryKey instanceof Number) {
                        String strKey = JSON.toJSONString(entryKey);
                        if (!this.applyName(serializer, object, strKey)) {
                            continue;
                        }
                    }
                }
            }
            {
                List<PropertyPreFilter> preFilters = this.propertyPreFilters;
                if (preFilters != null && preFilters.size() > 0) {
                    if (entryKey == null || entryKey instanceof String) {
                        if (!this.applyName(serializer, object, (String) entryKey)) {
                            continue;
                        }
                    } else if (entryKey.getClass().isPrimitive() || entryKey instanceof Number) {
                        String strKey = JSON.toJSONString(entryKey);
                        if (!this.applyName(serializer, object, strKey)) {
                            continue;
                        }
                    }
                }
            }
            {
                List<PropertyFilter> propertyFilters = serializer.propertyFilters;
                if (propertyFilters != null && propertyFilters.size() > 0) {
                    if (entryKey == null || entryKey instanceof String) {
                        if (!this.apply(serializer, object, (String) entryKey, value)) {
                            continue;
                        }
                    } else if (entryKey.getClass().isPrimitive() || entryKey instanceof Number) {
                        String strKey = JSON.toJSONString(entryKey);
                        if (!this.apply(serializer, object, strKey, value)) {
                            continue;
                        }
                    }
                }
            }
            {
                List<PropertyFilter> propertyFilters = this.propertyFilters;
                if (propertyFilters != null && propertyFilters.size() > 0) {
                    if (entryKey == null || entryKey instanceof String) {
                        if (!this.apply(serializer, object, (String) entryKey, value)) {
                            continue;
                        }
                    } else if (entryKey.getClass().isPrimitive() || entryKey instanceof Number) {
                        String strKey = JSON.toJSONString(entryKey);
                        if (!this.apply(serializer, object, strKey, value)) {
                            continue;
                        }
                    }
                }
            }
            {
                List<NameFilter> nameFilters = serializer.nameFilters;
                if (nameFilters != null && nameFilters.size() > 0) {
                    if (entryKey == null || entryKey instanceof String) {
                        entryKey = this.processKey(serializer, object, (String) entryKey, value);
                    } else if (entryKey.getClass().isPrimitive() || entryKey instanceof Number) {
                        String strKey = JSON.toJSONString(entryKey);
                        entryKey = this.processKey(serializer, object, strKey, value);
                    }
                }
            }
            {
                List<NameFilter> nameFilters = this.nameFilters;
                if (nameFilters != null && nameFilters.size() > 0) {
                    if (entryKey == null || entryKey instanceof String) {
                        entryKey = this.processKey(serializer, object, (String) entryKey, value);
                    } else if (entryKey.getClass().isPrimitive() || entryKey instanceof Number) {
                        String strKey = JSON.toJSONString(entryKey);
                        entryKey = this.processKey(serializer, object, strKey, value);
                    }
                }
            }
            {
                if (entryKey == null || entryKey instanceof String) {
                    value = this.processValue(serializer, null, object, (String) entryKey, value, features);
                } else {
                    boolean objectOrArray = entryKey instanceof Map || entryKey instanceof Collection;
                    if (!objectOrArray) {
                        String strKey = JSON.toJSONString(entryKey);
                        value = this.processValue(serializer, null, object, strKey, value, features);
                    }
                }
            }
            if (value == null) {
                if (!SerializerFeature.isEnabled(out.features, features, SerializerFeature.WriteMapNullValue)) {
                    continue;
                }
            }
            if (entryKey instanceof String) {
                String key = (String) entryKey;
                if (!first) {
                    out.write(',');
                }
                if (out.isEnabled(SerializerFeature.PrettyFormat)) {
                    serializer.println();
                }
                out.writeFieldName(key, true);
            } else {
                if (!first) {
                    out.write(',');
                }
                if ((out.isEnabled(NON_STRINGKEY_AS_STRING) || SerializerFeature.isEnabled(features, SerializerFeature.WriteNonStringKeyAsString)) && !(entryKey instanceof Enum)) {
                    String strEntryKey = JSON.toJSONString(entryKey);
                    serializer.write(strEntryKey);
                } else {
                    serializer.write(entryKey);
                }
                out.write(':');
            }
            first = false;
            if (value == null) {
                out.writeNull();
                continue;
            }
            Class<?> clazz = value.getClass();
            if (clazz != preClazz) {
                preClazz = clazz;
                preWriter = serializer.getObjectWriter(clazz);
            }
            if (SerializerFeature.isEnabled(features, SerializerFeature.WriteClassName) && preWriter instanceof JavaBeanSerializer) {
                Type valueType = null;
                if (fieldType instanceof ParameterizedType) {
                    ParameterizedType parameterizedType = (ParameterizedType) fieldType;
                    Type[] actualTypeArguments = parameterizedType.getActualTypeArguments();
                    if (actualTypeArguments.length == 2) {
                        valueType = actualTypeArguments[1];
                    }
                }
                JavaBeanSerializer javaBeanSerializer = (JavaBeanSerializer) preWriter;
                javaBeanSerializer.writeNoneASM(serializer, value, entryKey, valueType, features);
            } else {
                preWriter.write(serializer, value, entryKey, null, features);
            }
        }
    } finally {
        serializer.context = parent;
    }
    serializer.decrementIdent();
    if (out.isEnabled(SerializerFeature.PrettyFormat) && map.size() > 0) {
        serializer.println();
    }
    if (!unwrapped) {
        out.write('}');
    }
}

@SuppressWarnings("unchecked")
private <T> T toObjectArray(DefaultJSONParser parser, Class<?> componentType, JSONArray array) {
    if (array == null) {
        return null;
    }
    int size = array.size();
    Object objArray = Array.newInstance(componentType, size);
    for (int i = 0; i < size; ++i) {
        Object value = array.get(i);
        if (value == array) {
            Array.set(objArray, i, objArray);
            continue;
        }
        if (componentType.isArray()) {
            Object element;
            if (componentType.isInstance(value)) {
                element = value;
            } else {
                element = toObjectArray(parser, componentType, (JSONArray) value);
            }
            Array.set(objArray, i, element);
        } else {
            Object element = null;
            if (value instanceof JSONArray) {
                boolean contains = false;
                JSONArray valueArray = (JSONArray) value;
                int valueArraySize = valueArray.size();
                for (int y = 0; y < valueArraySize; ++y) {
                    Object valueItem = valueArray.get(y);
                    if (valueItem == array) {
                        valueArray.set(i, objArray);
                        contains = true;
                    }
                }
                if (contains) {
                    element = valueArray.toArray();
                }
            }
            if (element == null) {
                element = TypeUtils.cast(value, componentType, parser.getConfig());
            }
            Array.set(objArray, i, element);
        }
    }
    array.setRelatedArray(objArray);
    array.setComponentType(componentType);
    // TODO
    return (T) objArray;
