            put(clazz, writer = MiscCodec.instance);
        } else {
            if (// 
            className.startsWith("java.awt.") && // 
            AwtCodec.support(clazz)) {
                // awt
                if (!awtError) {
                    try {
                        String[] names = new String[] { "java.awt.Color", "java.awt.Font", "java.awt.Point", "java.awt.Rectangle" };
