public void writeByteArray(byte[] bytes) {
    if (isEnabled(SerializerFeature.WriteClassName.mask)) {
        writeHex(bytes);
        return;
    }
    int bytesLen = bytes.length;
    final char quote = useSingleQuotes ? '\'' : '"';
    if (bytesLen == 0) {
        String emptyString = useSingleQuotes ? "''" : "\"\"";
        write(emptyString);
        return;
    }
    final char[] CA = IOUtils.CA;
    // base64 algorithm author Mikael Grev
    // Length of even 24-bits.
    int eLen = (bytesLen / 3) * 3;
    // base64 character count
    int charsLen = ((bytesLen - 1) / 3 + 1) << 2;
    // char[] chars = new char[charsLen];
    int offset = count;
    int newcount = count + charsLen + 2;
    if (newcount > buf.length) {
        if (writer != null) {
            write(quote);
            for (int s = 0; s < eLen; ) {
                // Copy next three bytes into lower 24 bits of int, paying attension to sign.
                int i = (bytes[s++] & 0xff) << 16 | (bytes[s++] & 0xff) << 8 | (bytes[s++] & 0xff);
                // Encode the int into four chars
                write(CA[(i >>> 18) & 0x3f]);
                write(CA[(i >>> 12) & 0x3f]);
                write(CA[(i >>> 6) & 0x3f]);
                write(CA[i & 0x3f]);
            }
            // Pad and encode last bits if source isn't even 24 bits.
            // 0 - 2.
            int left = bytesLen - eLen;
            if (left > 0) {
                // Prepare the int
                int i = ((bytes[eLen] & 0xff) << 10) | (left == 2 ? ((bytes[bytesLen - 1] & 0xff) << 2) : 0);
                // Set last four chars
                write(CA[i >> 12]);
                write(CA[(i >>> 6) & 0x3f]);
                write(left == 2 ? CA[i & 0x3f] : '=');
                write('=');
            }
            write(quote);
            return;
        }
        expandCapacity(newcount);
    }
    count = newcount;
    buf[offset++] = quote;
    // Encode even 24-bits
    for (int s = 0, d = offset; s < eLen; ) {
        // Copy next three bytes into lower 24 bits of int, paying attension to sign.
        int i = (bytes[s++] & 0xff) << 16 | (bytes[s++] & 0xff) << 8 | (bytes[s++] & 0xff);
        // Encode the int into four chars
        buf[d++] = CA[(i >>> 18) & 0x3f];
        buf[d++] = CA[(i >>> 12) & 0x3f];
        buf[d++] = CA[(i >>> 6) & 0x3f];
        buf[d++] = CA[i & 0x3f];
    }
    // Pad and encode last bits if source isn't even 24 bits.
    // 0 - 2.
    int left = bytesLen - eLen;
    if (left > 0) {
        // Prepare the int
        int i = ((bytes[eLen] & 0xff) << 10) | (left == 2 ? ((bytes[bytesLen - 1] & 0xff) << 2) : 0);
        // Set last four chars
        buf[newcount - 5] = CA[i >> 12];
        buf[newcount - 4] = CA[(i >>> 6) & 0x3f];
        buf[newcount - 3] = left == 2 ? CA[i & 0x3f] : '=';
        buf[newcount - 2] = '=';
    }
    buf[newcount - 1] = quote;
}

