                buf[i + 1] = replaceChars[(int) ch];
                end += 1;
                continue;
            }
            if (// 
            ch == '"' || // 
            ch == '/' || ch == '\\') {
                System.arraycopy(buf, i + 1, buf, i + 2, end - i - 1);
                buf[i] = '\\';
                buf[i + 1] = ch;
                end += 1;
                continue;
            }
            if (ch < 32) {
                System.arraycopy(buf, i + 1, buf, i + 6, end - i - 1);
                buf[i] = '\\';
                buf[i + 1] = 'u';
                buf[i + 2] = '0';
                buf[i + 3] = '0';
                buf[i + 4] = IOUtils.ASCII_CHARS[ch * 2];
                buf[i + 5] = IOUtils.ASCII_CHARS[ch * 2 + 1];
                end += 5;
                continue;
            }
            if (ch >= 127) {
                System.arraycopy(buf, i + 1, buf, i + 6, end - i - 1);
