@Override
protected Object convertFromInternal(Message<?> message, Class<?> targetClass, Object conversionHint) {
    // parse byte[] or String payload to Java Object
    Object payload = message.getPayload();
    Object obj = null;
    if (payload instanceof byte[]) {
        obj = JSON.parseObject((byte[]) payload, fastJsonConfig.getCharset(), targetClass, fastJsonConfig.getParserConfig(), fastJsonConfig.getParseProcess(), JSON.DEFAULT_PARSER_FEATURE, fastJsonConfig.getFeatures());
    } else if (payload instanceof String) {
        obj = JSON.parseObject((String) payload, targetClass, fastJsonConfig.getParserConfig(), fastJsonConfig.getParseProcess(), JSON.DEFAULT_PARSER_FEATURE, fastJsonConfig.getFeatures());
    }
    return obj;
}

@Override
protected Object convertToInternal(Object payload, MessageHeaders headers, Object conversionHint) {
    // encode payload to json string or byte[]
    Object obj;
    if (byte[].class == getSerializedPayloadClass()) {
        if (payload instanceof String && JSON.isValid((String) payload)) {
            obj = ((String) payload).getBytes(fastJsonConfig.getCharset());
        } else {
            obj = JSON.toJSONBytesWithFastJsonConfig(fastJsonConfig.getCharset(), payload, fastJsonConfig.getSerializeConfig(), fastJsonConfig.getSerializeFilters(), fastJsonConfig.getDateFormat(), JSON.DEFAULT_GENERATE_FEATURE, fastJsonConfig.getSerializerFeatures());
        }
    } else {
        if (payload instanceof String && JSON.isValid((String) payload)) {
            obj = payload;
        } else {
            obj = JSON.toJSONString(payload, fastJsonConfig.getSerializeConfig(), fastJsonConfig.getSerializeFilters(), fastJsonConfig.getDateFormat(), JSON.DEFAULT_GENERATE_FEATURE, fastJsonConfig.getSerializerFeatures());
        }
    }
    return obj;
