    int i2 = (int) i;
    while (i2 >= 65536) {
        q2 = i2 / 100;
        // really: r = i2 - (q * 100);
        r = i2 - ((q2 << 6) + (q2 << 5) + (q2 << 2));
        i2 = q2;
        buf[--charPos] = DigitOnes[r];
        buf[--charPos] = DigitTens[r];
    }
    // Fall thru to fast mode for smaller numbers
    // assert(i2 <= 65536, i2);
    for (; ; ) {
        q2 = (i2 * 52429) >>> (16 + 3);
        // r = i2-(q2*10) ...
