            }
            int current = index;
            for (int i = 0; i < olength; i++) {
                result[current + olength - i - 1] = (char) ('0' + output % 10);
                output /= 10;
                index++;
            }
        } else if (exp + 1 >= olength) {
            // Decimal dot is after any of the digits.
            for (int i = 0; i < olength; i++) {
                result[index + olength - i - 1] = (char) ('0' + output % 10);
                output /= 10;
            }
            index += olength;
            for (int i = olength; i < exp + 1; i++) {
                result[index++] = '0';
