public static <T> Set<T> load(Class<T> clazz, ClassLoader classLoader) {
    if (classLoader == null) {
        return Collections.emptySet();
    }
    Set<T> services = new HashSet<T>();
    String className = clazz.getName();
    String path = PREFIX + className;
    Set<String> serviceNames = new HashSet<String>();
    try {
        Enumeration<URL> urls = classLoader.getResources(path);
        while (urls.hasMoreElements()) {
            URL url = urls.nextElement();
            if (loadedUrls.contains(url.toString())) {
                continue;
            }
            load(url, serviceNames);
            loadedUrls.add(url.toString());
        }
    } catch (Throwable ex) {
        // skip
    }
    for (String serviceName : serviceNames) {
        try {
            Class<?> serviceClass = classLoader.loadClass(serviceName);
            T service = (T) serviceClass.newInstance();
            services.add(service);
        } catch (Exception e) {
            // skip
        }
    }
    return services;
}

private static int getAllocateLengthExp(int minExp, int maxExp, int length) {
    assert (1 << maxExp) >= length;
    // int max = 1 << maxExp;
    // if(length>= max) {
    // return length;
    // }
    int part = length >>> minExp;
    if (part <= 0) {
        return 1 << minExp;
    }
    return 1 << 32 - Integer.numberOfLeadingZeros(length - 1);
}

