static boolean isSpecial(char ch) {
    if (ch <= 31) {
        return true;
    }
    if (ch > '\\') {
        // 92
        return false;
    }
    return ((1L << (ch - 31)) & flags) != 0;
}

static boolean isSpecial(char ch, int features) {
    // if (ch > ']') {
    // return false;
    // }
    if (ch == ' ') {
        // 32
        return false;
    }
    if (ch == '/') {
        // 47
        return SerializerFeature.isEnabled(features, SerializerFeature.WriteSlashAsSpecial);
    }
    if (// 35
    ch > '#' && // 92
    ch != '\\') {
        return false;
    }
    if (// 31
    ch <= 0x1F || // 92
    ch == '\\' || // 34
    ch == '"') {
        return true;
    }
    return false;
}

