// ****************************************************************************************
// *  char[] version
// ****************************************************************************************
/**
 * Encodes a raw byte array into a BASE64 <code>char[]</code> representation i accordance with RFC 2045.
 * @param bytes The bytes to convert. If <code>null</code> or length 0 an empty array will be returned.
 * @param lineSep Optional "\r\n" after 76 characters, unless end of file.<br>
 * No line separator will be in breach of RFC 2045 which specifies max 76 per line but will be a
 * little faster.
 * @return A BASE64 encoded array. Never <code>null</code>.
 */
public final static char[] encodeToChar(byte[] bytes, boolean lineSep) {
    // Check special case
    int bytes_len = bytes != null ? bytes.length : 0;
    if (bytes_len == 0)
        return new char[0];
    // Length of even 24-bits.
    int eLen = (bytes_len / 3) * 3;
    // Returned character count
    int cCnt = ((bytes_len - 1) / 3 + 1) << 2;
    // Length of returned array
    int chars_len = cCnt + (lineSep ? (cCnt - 1) / 76 << 1 : 0);
    char[] chars = new char[chars_len];
    // Encode even 24-bits
    for (int s = 0, d = 0, cc = 0; s < eLen; ) {
        // Copy next three bytes into lower 24 bits of int, paying attension to sign.
        int i = (bytes[s++] & 0xff) << 16 | (bytes[s++] & 0xff) << 8 | (bytes[s++] & 0xff);
        // Encode the int into four chars
        chars[d++] = CA[(i >>> 18) & 0x3f];
        chars[d++] = CA[(i >>> 12) & 0x3f];
        chars[d++] = CA[(i >>> 6) & 0x3f];
        chars[d++] = CA[i & 0x3f];
        // Add optional line separator
        if (lineSep && ++cc == 19 && d < chars_len - 2) {
            chars[d++] = '\r';
            chars[d++] = '\n';
            cc = 0;
        }
    }
    // Pad and encode last bits if source isn't even 24 bits.
    // 0 - 2.
    int left = bytes_len - eLen;
    if (left > 0) {
        // Prepare the int
        int i = ((bytes[eLen] & 0xff) << 10) | (left == 2 ? ((bytes[bytes_len - 1] & 0xff) << 2) : 0);
        // Set last four chars
        chars[chars_len - 4] = CA[i >> 12];
        chars[chars_len - 3] = CA[(i >>> 6) & 0x3f];
        chars[chars_len - 2] = left == 2 ? CA[i & 0x3f] : '=';
        chars[chars_len - 1] = '=';
    }
    return chars;
}

/**
 * Decodes a BASE64 encoded char array. All illegal characters will be ignored and can handle both arrays with
 * and without line separators.
 * @param sArr The source array. <code>null</code> or length 0 will return an empty array.
 * @return The decoded array of bytes. May be of length 0. Will be <code>null</code> if the legal characters
 * (including '=') isn't divideable by 4.  (I.e. definitely corrupted).
 */
public final static byte[] decode(char[] sArr) {
    // Check special case
    int sLen = sArr != null ? sArr.length : 0;
    if (sLen == 0)
        return new byte[0];
    // Count illegal characters (including '\r', '\n') to know what size the returned array will be,
    // so we don't have to reallocate & copy it later.
    // Number of separator characters. (Actually illegal characters, but that's a bonus...)
    int sepCnt = 0;
    for (// If input is "pure" (I.e. no line separators or illegal chars) base64 this loop can be commented out.
    int i = 0; // If input is "pure" (I.e. no line separators or illegal chars) base64 this loop can be commented out.
    i < sLen; // If input is "pure" (I.e. no line separators or illegal chars) base64 this loop can be commented out.
    i++) if (IA[sArr[i]] < 0)
        sepCnt++;
    // Check so that legal chars (including '=') are evenly divideable by 4 as specified in RFC 2045.
    if ((sLen - sepCnt) % 4 != 0)
        return null;
    int pad = 0;
    for (int i = sLen; i > 1 && IA[sArr[--i]] <= 0; ) if (sArr[i] == '=')
        pad++;
    int len = ((sLen - sepCnt) * 6 >> 3) - pad;
    // Preallocate byte[] of exact length
    byte[] dArr = new byte[len];
    for (int s = 0, d = 0; d < len; ) {
        // Assemble three bytes into an int from four "valid" characters.
        int i = 0;
        for (int j = 0; j < 4; j++) {
            // j only increased if a valid char was found.
            int c = IA[sArr[s++]];
            if (c >= 0)
                i |= c << (18 - j * 6);
            else
                j--;
        }
        // Add the bytes
        dArr[d++] = (byte) (i >> 16);
        if (d < len) {
            dArr[d++] = (byte) (i >> 8);
            if (d < len)
                dArr[d++] = (byte) i;
        }
    }
    return dArr;
}

/**
 * Decodes a BASE64 encoded char array that is known to be resonably well formatted. The method is about twice as
 * fast as {@link #decode(char[])}. The preconditions are:<br>
 * + The array must have a line length of 76 chars OR no line separators at all (one line).<br>
 * + Line separator must be "\r\n", as specified in RFC 2045
 * + The array must not contain illegal characters within the encoded string<br>
 * + The array CAN have illegal characters at the beginning and end, those will be dealt with appropriately.<br>
 * @param sArr The source array. Length 0 will return an empty array. <code>null</code> will throw an exception.
 * @return The decoded array of bytes. May be of length 0.
 */
public final static byte[] decodeFast(char[] sArr) {
    // Check special case
    int sLen = sArr.length;
    if (sLen == 0)
        return new byte[0];
    // Start and end index after trimming.
    int sIx = 0, eIx = sLen - 1;
    // Trim illegal chars from start
    while (sIx < eIx && IA[sArr[sIx]] < 0) sIx++;
    // Trim illegal chars from end
    while (eIx > 0 && IA[sArr[eIx]] < 0) eIx--;
    // get the padding count (=) (0, 1 or 2)
    // Count '=' at end.
    int pad = sArr[eIx] == '=' ? (sArr[eIx - 1] == '=' ? 2 : 1) : 0;
    // Content count including possible separators
    int cCnt = eIx - sIx + 1;
    int sepCnt = sLen > 76 ? (sArr[76] == '\r' ? cCnt / 78 : 0) << 1 : 0;
    // The number of decoded bytes
    int len = ((cCnt - sepCnt) * 6 >> 3) - pad;
    // Preallocate byte[] of exact length
    byte[] dArr = new byte[len];
    // Decode all but the last 0 - 2 bytes.
    int d = 0;
    for (int cc = 0, eLen = (len / 3) * 3; d < eLen; ) {
        // Assemble three bytes into an int from four "valid" characters.
        int i = IA[sArr[sIx++]] << 18 | IA[sArr[sIx++]] << 12 | IA[sArr[sIx++]] << 6 | IA[sArr[sIx++]];
        // Add the bytes
        dArr[d++] = (byte) (i >> 16);
        dArr[d++] = (byte) (i >> 8);
        dArr[d++] = (byte) i;
        // If line separator, jump over it.
        if (sepCnt > 0 && ++cc == 19) {
            sIx += 2;
            cc = 0;
        }
    }
    if (d < len) {
        // Decode last 1-3 bytes (incl '=') into 1-3 bytes
        int i = 0;
        for (int j = 0; sIx <= eIx - pad; j++) i |= IA[sArr[sIx++]] << (18 - j * 6);
        for (int r = 16; d < len; r -= 8) dArr[d++] = (byte) (i >> r);
    }
    return dArr;
}

